# process-mrva-results 0.0.1
extensions:
- addsTo:
    extensible: typeModel
    pack: codeql/python-all
  data:
  - - Django.db.models.Model~Subclass
    - benchmarks
    - Member[run_benchmarks].Member[ContentType]
  - - Django.db.models.Model~Subclass
    - benchmarks
    - Member[run_benchmarks].Member[Group]
  - - Django.db.models.Model~Subclass
    - benchmarks
    - Member[run_benchmarks].Member[User]
  - - io.StringIO~Subclass
    - benchmarks
    - Member[bm].Member[utils].Member[BytesIO]
